import React from 'react';
import * as style from './styled'

const Repositories = () => {
  const [repository, setRepository] = React.useState([])
  React.useEffect(() => {
    const allRepositories = window.localStorage.getItem('allRepositories')
    setRepository(allRepositories)
  }, [])
  return (
    <>
      <p></p>
      <style.Title>GitHub Repositories</style.Title>
      <style.List>
        <style.ListItem>#01</style.ListItem>
        <style.ListItem>#02</style.ListItem>
        <style.ListItem>#03</style.ListItem>
        <style.ListItem>#04</style.ListItem>
        <style.ListItem>#05</style.ListItem>
      </style.List>
    </>
  )
}

export default Repositories
